    slika: "",
    opis: "",
    velikost: Array<number>(),
    zdrastvenoStanje: Array<String>()
    });

    const handleSubmit = (e: FormEvent) => {
        e.preventDefault();
        
        let data = {
            naziv: lastnosti.naziv,
            slika: lastnosti.slika,
            opis: lastnosti.opis,
            velikost: lastnosti.velikost,
            zdrastvenoStanje: lastnosti.zdrastvenoStanje
        }

        fetch("http://localhost:3001/dodan_course", {
            method: 'POST',
            body: JSON.stringify(data),
            headers: {
                'Content-Type': 'application/json'
            }
        })
    }

